import { useEffect, useRef, useState } from 'react'

import { Designer, type Template } from '@pdfme/ui'
import { jsPDF } from 'jspdf'

const [height, width] = [800, 800]

const doc = new jsPDF('landscape', 'mm', [height, width])
const basePdf = doc.output('datauristring')

const getTemplate = (): Template => ({
  schemas: [
    {
      name: {
        type: 'text',
        position: {
          x: 25.06,
          y: 26.35,
        },
        width: 77.77,
        height: 18.7,
        fontSize: 36,
        fontColor: '#14b351',
      },
    },
    {
      background: {
        type: 'image',
        position: {
          x: 0,
          y: 0,
        },
        width,
        height,
      },
    },
  ],
  basePdf,
  sampledata: [
    {
      name: 'Book',
      background:
        'data:application/pdf;base64,',
    },
  ],
  columns: ['name', 'background'],
})

const Page = () => {
  const sampleTemplate = getTemplate()

  const designer = useRef<Designer | null>(null)
  const designerRef = useRef<HTMLDivElement | null>(null)
  const [template, setTemplate] = useState<Template>(sampleTemplate)

  useEffect(() => {
    if (!designerRef.current) {
      return
    }
    designer.current = new Designer({
      domContainer: designerRef.current,
      template,
    })
    // designer.current.onSaveTemplate(downloadTemplate)
    designer.current.onChangeTemplate(setTemplate)

    return () => {
      designer.current?.destroy()
    }
  }, [template, designerRef])

  return (
    <>
      <div
        ref={designerRef}
        style={{
          width: '100%',
          height: 'calc(100vh)',
        }}
      />
    </>
  )
}

export default Page
